import React, { useState, useEffect } from 'react';
import {Component} from 'react';
import { DataTable } from 'primereact/datatable';
import { Dropdown } from 'primereact/dropdown'
import { Column } from 'primereact/column';
import { ProductService } from './service/ProductService';
import { MunicipioZonaDataService }  from './service/municipio_zona.service';

class App extends Component {
    constructor(props) {
        super();
        this.state = {
            municipios: [],
            zonas: []
        };
    }
    componentDidMount() {
        this.retrieveZonas();
        this.retrieveMunicipios();
      }
    retrieveZonas() {
        MunicipioZonaDataService.getAllZonas()
        .then(response => {
          this.setState({
            zonas: response.data 
          });
          console.log(response.data);
        })
        .catch(e => {
          console.log(e);
        });
        zonas.forEach((zona, index) => {
            zona.LABEL = zona.NUMERO + " - " + zona.SEDE;
        });
    }
    retrieveMunicipios() {
        MunicipioZonaDataService.getAllMunicipios()
        .then(response => {
          this.setState({
            municipios: response.data 
          });
          console.log(response.data);
        })
        .catch(e => {
          console.log(e);
        });

    }
    render() {
        return (
            <div className="card flex justify-content-center">
            <Dropdown value={selectedZona} onChange={(e) => setSelectedZona(e.value)} options={zonas} optionLabel="LABEL" 
                placeholder="Escolha uma zona" className="w-full md:w-14rem" filter/>
            <div className="card">
                <DataTable value={municipios} tableStyle={{ minWidth: '50rem' }} rows={5} paginator>
                    <Column field="ID" sortable header="Code"></Column>
                    <Column field="NOME" sortable header="Name"></Column>
                </DataTable>
            </div>  
        </div>
        );
    }


}

export default App;
